  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes data collected in
  1998 to evaluate the ability of lidar to survey airport obstructions in collaboration
  with NOAA National Geodetic Survey. The laser emits laser beams at high frequency
  and is directed downward at the earth's surface through a port opening in the bottom
  of the aircraft's fuselage. The laser system records the time difference between
  emission of the laser beam and the reception of the reflected laser signal in the
  aircraft. The aircraft travels over the ground at approximately 60 meters per second
  while surveying.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
